// SPDX-License-Identifier: MIT

pragma solidity ^0.8.11;

//  * Strings Library
//  *
//  * In summary this is a simple library of string functions which make simple
//  * string operations less tedious in solidity.
//  *
//  * Please be aware these functions can be quite gas heavy so use them only when
//  * necessary not to clog the blockchain with expensive transactions.

library Strings {
    bytes16 private constant _HEX_SYMBOLS = "0123456789abcdef";

    /**
     * @dev Converts a bytes` to its ASCII `string` decimal representation.
     */

    function toString(bytes memory data) public pure returns (string memory) {
        bytes memory buffer = new bytes(2 + data.length * 2);
        buffer[0] = "0";
        buffer[1] = "x";
        for (uint256 i = 0; i < data.length; i++) {
            buffer[2 + i * 2] = _HEX_SYMBOLS[uint256(uint8(data[i] >> 4))];
            buffer[3 + i * 2] = _HEX_SYMBOLS[uint256(uint8(data[i] & 0x0f))];
        }
        return string(buffer);
    }

    /**
     * @dev Converts a `uint256` to its ASCII `string` decimal representation.
     */
    function uint256ToString(uint256 _value)
        internal
        pure
        returns (string memory)
    {
        if (_value == 0) {
            return "0";
        }
        uint256 temp = _value;
        uint256 digits;
        while (temp != 0) {
            digits++;
            temp /= 10;
        }
        bytes memory buffer = new bytes(digits);
        while (_value != 0) {
            digits -= 1;
            buffer[digits] = bytes1(uint8(48 + uint256(_value % 10)));
            _value /= 10;
        }
        return string(buffer);
    }

    /**
     * @dev Converts a `uint256` to its ASCII `string` hexadecimal representation.
     */

    function toHexString(uint256 _value) internal pure returns (string memory) {
        if (_value == 0) {
            return "0x00";
        }
        uint256 temp = _value;
        uint256 _length = 0;
        while (temp != 0) {
            _length++;
            temp >>= 8;
        }
        return toHexStringFixedLength(_value, _length);
    }

    /**
     * @dev Converts a `uint256` to its ASCII `string` hexadecimal representation with fixed length.
     */
    function toHexStringFixedLength(uint256 _value, uint256 _length)
        internal
        pure
        returns (string memory)
    {
        bytes memory buffer = new bytes(2 * _length + 2);
        buffer[0] = "0";
        buffer[1] = "x";
        for (uint256 i = 2 * _length + 1; i > 1; --i) {
            buffer[i] = _HEX_SYMBOLS[_value & 0xf];
            _value >>= 4;
        }
        require(_value == 0, "Strings: hex length insufficient");
        return string(buffer);
    }

    //  * Concat (High gas cost)
    //  *
    //  * Appends two strings together and returns a new value
    //  *
    //  * @param _base When being used for a data type this is the extended object
    //  *              otherwise this is the string which will be the concatenated
    //  *              prefix
    //  * @param _value The value to be the concatenated suffix
    //  * @return string The resulting string from combinging the base and value

    function concat(string memory _base, string memory _value)
        internal
        pure
        returns (string memory)
    {
        bytes memory _baseBytes = bytes(_base);
        bytes memory _valueBytes = bytes(_value);

        assert(_valueBytes.length > 0);

        string memory _tmpValue = new string(
            _baseBytes.length + _valueBytes.length
        );
        bytes memory _newValue = bytes(_tmpValue);

        uint256 i;
        uint256 j;

        for (i = 0; i < _baseBytes.length; i++) {
            _newValue[j++] = _baseBytes[i];
        }

        for (i = 0; i < _valueBytes.length; i++) {
            _newValue[j++] = _valueBytes[i];
        }

        return string(_newValue);
    }

    //  * Index Of
    //  *
    //  * Locates and returns the position of a character within a string
    //  *
    //  * @param _base When being used for a data type this is the extended object
    //  *              otherwise this is the string acting as the haystack to be
    //  *              searched
    //  * @param _value The needle to search for, at present this is currently
    //  *               limited to one character
    //  * @return int The position of the needle starting from 0 and returning -1
    //  *             in the case of no matches found

    function indexOf(string memory _base, string memory _value)
        internal
        pure
        returns (int256)
    {
        return _indexOf(_base, _value, 0);
    }

    //  * Index Of
    //  *
    //  * Locates and returns the position of a character within a string starting
    //  * from a defined offset
    //  *
    //  * @param _base When being used for a data type this is the extended object
    //  *              otherwise this is the string acting as the haystack to be
    //  *              searched
    //  * @param _value The needle to search for, at present this is currently
    //  *               limited to one character
    //  * @param _offset The starting point to start searching from which can start
    //  *                from 0, but must not exceed the length of the string
    //  * @return int The position of the needle starting from 0 and returning -1
    //  *             in the case of no matches found

    function _indexOf(
        string memory _base,
        string memory _value,
        uint256 _offset
    ) internal pure returns (int256) {
        bytes memory _baseBytes = bytes(_base);
        bytes memory _valueBytes = bytes(_value);

        assert(_valueBytes.length == 1);

        for (uint256 i = _offset; i < _baseBytes.length; i++) {
            if (_baseBytes[i] == _valueBytes[0]) {
                return int256(i);
            }
        }

        return -1;
    }

    //  * Length
    //  *
    //  * Returns the length of the specified string
    //  *
    //  * @param _base When being used for a data type this is the extended object
    //  *              otherwise this is the string to be measured
    //  * @return uint The length of the passed string

    function length(string memory _base) internal pure returns (uint256) {
        bytes memory _baseBytes = bytes(_base);
        return _baseBytes.length;
    }

    //  * Sub String
    //  *
    //  * Extracts the beginning part of a string based on the desired length
    //  *
    //  * @param _base When being used for a data type this is the extended object
    //  *              otherwise this is the string that will be used for
    //  *              extracting the sub string from
    //  * @param _length The length of the sub string to be extracted from the base
    //  * @return string The extracted sub string

    function substring(string memory _base, int256 _length)
        internal
        pure
        returns (string memory)
    {
        return _substring(_base, _length, 0);
    }

    //  * Sub String
    //  *
    //  * Extracts the part of a string based on the desired length and offset. The
    //  * offset and length must not exceed the lenth of the base string.
    //  *
    //  * @param _base When being used for a data type this is the extended object
    //  *              otherwise this is the string that will be used for
    //  *              extracting the sub string from
    //  * @param _length The length of the sub string to be extracted from the base
    //  * @param _offset The starting point to extract the sub string from
    //  * @return string The extracted sub string

    function _substring(
        string memory _base,
        int256 _length,
        int256 _offset
    ) internal pure returns (string memory) {
        bytes memory _baseBytes = bytes(_base);

        assert(uint256(_offset + _length) <= _baseBytes.length);

        string memory _tmp = new string(uint256(_length));
        bytes memory _tmpBytes = bytes(_tmp);

        uint256 j = 0;
        for (
            uint256 i = uint256(_offset);
            i < uint256(_offset + _length);
            i++
        ) {
            _tmpBytes[j++] = _baseBytes[i];
        }

        return string(_tmpBytes);
    }

    //  * String Split (Very high gas cost)
    //  *
    //  * Splits a string into an array of strings based off the delimiter value.
    //  * Please note this can be quite a gas expensive function due to the use of
    //  * storage so only use if really required.
    //  *
    //  * @param _base When being used for a data type this is the extended object
    //  *               otherwise this is the string value to be split.
    //  * @param _value The delimiter to split the string on which must be a single
    //  *               character
    //  * @return string[] An array of values split based off the delimiter, but
    //  *                  do not container the delimiter.

    function split(string memory _base, string memory _value)
        internal
        pure
        returns (string[] memory splitArr)
    {
        bytes memory _baseBytes = bytes(_base);

        uint256 _offset = 0;
        uint256 _splitsCount = 1;
        while (_offset < _baseBytes.length - 1) {
            int256 _limit = _indexOf(_base, _value, _offset);
            if (_limit == -1) break;
            else {
                _splitsCount++;
                _offset = uint256(_limit) + 1;
            }
        }

        splitArr = new string[](_splitsCount);

        _offset = 0;
        _splitsCount = 0;
        while (_offset < _baseBytes.length - 1) {
            int256 _limit = _indexOf(_base, _value, _offset);
            if (_limit == -1) {
                _limit = int256(_baseBytes.length);
            }

            string memory _tmp = new string(uint256(_limit) - _offset);
            bytes memory _tmpBytes = bytes(_tmp);

            uint256 j = 0;
            for (uint256 i = _offset; i < uint256(_limit); i++) {
                _tmpBytes[j++] = _baseBytes[i];
            }
            _offset = uint256(_limit) + 1;
            splitArr[_splitsCount++] = string(_tmpBytes);
        }
        return splitArr;
    }

    //  * Compare To
    //  *
    //  * Compares the characters of two strings, to ensure that they have an
    //  * identical footprint
    //  *
    //  * @param _base When being used for a data type this is the extended object
    //  *               otherwise this is the string base to compare against
    //  * @param _value The string the base is being compared to
    //  * @return bool Simply notates if the two string have an equivalent

    function compareTo(string memory _base, string memory _value)
        internal
        pure
        returns (bool)
    {
        bytes memory _baseBytes = bytes(_base);
        bytes memory _valueBytes = bytes(_value);

        if (_baseBytes.length != _valueBytes.length) {
            return false;
        }

        for (uint256 i = 0; i < _baseBytes.length; i++) {
            if (_baseBytes[i] != _valueBytes[i]) {
                return false;
            }
        }

        return true;
    }

    //  * Compare To Ignore Case (High gas cost)
    //  *
    //  * Compares the characters of two strings, converting them to the same case
    //  * where applicable to alphabetic characters to distinguish if the values
    //  * match.
    //  *
    //  * @param _base When being used for a data type this is the extended object
    //  *               otherwise this is the string base to compare against
    //  * @param _value The string the base is being compared to
    //  * @return bool Simply notates if the two string have an equivalent value
    //  *              discarding case

    function compareToIgnoreCase(string memory _base, string memory _value)
        internal
        pure
        returns (bool)
    {
        bytes memory _baseBytes = bytes(_base);
        bytes memory _valueBytes = bytes(_value);

        if (_baseBytes.length != _valueBytes.length) {
            return false;
        }

        for (uint256 i = 0; i < _baseBytes.length; i++) {
            if (
                _baseBytes[i] != _valueBytes[i] &&
                _upper(_baseBytes[i]) != _upper(_valueBytes[i])
            ) {
                return false;
            }
        }

        return true;
    }

    //  * Upper
    //  *
    //  * Converts all the values of a string to their corresponding upper case
    //  * value.
    //  *
    //  * @param _base When being used for a data type this is the extended object
    //  *              otherwise this is the string base to convert to upper case
    //  * @return string

    function upper(string memory _base) internal pure returns (string memory) {
        bytes memory _baseBytes = bytes(_base);
        for (uint256 i = 0; i < _baseBytes.length; i++) {
            _baseBytes[i] = _upper(_baseBytes[i]);
        }
        return string(_baseBytes);
    }

    //  * Lower
    //  *
    //  * Converts all the values of a string to their corresponding lower case
    //  * value.
    //  *
    //  * @param _base When being used for a data type this is the extended object
    //  *              otherwise this is the string base to convert to lower case
    //  * @return string

    function lower(string memory _base) internal pure returns (string memory) {
        bytes memory _baseBytes = bytes(_base);
        for (uint256 i = 0; i < _baseBytes.length; i++) {
            _baseBytes[i] = _lower(_baseBytes[i]);
        }
        return string(_baseBytes);
    }

    //  * Upper
    //  *
    //  * Convert an alphabetic character to upper case and return the original
    //  * value when not alphabetic
    //  *
    //  * @param _b1 The byte to be converted to upper case
    //  * @return bytes1 The converted value if the passed value was alphabetic
    //  *                and in a lower case otherwise returns the original value

    function _upper(bytes1 _b1) private pure returns (bytes1) {
        if (_b1 >= 0x61 && _b1 <= 0x7A) {
            return bytes1(uint8(_b1) - 32);
        }

        return _b1;
    }

    //  * Lower
    //  *
    //  * Convert an alphabetic character to lower case and return the original
    //  * value when not alphabetic
    //  *
    //  * @param _b1 The byte to be converted to lower case
    //  * @return bytes1 The converted value if the passed value was alphabetic
    //  *                and in a upper case otherwise returns the original value

    function _lower(bytes1 _b1) private pure returns (bytes1) {
        if (_b1 >= 0x41 && _b1 <= 0x5A) {
            return bytes1(uint8(_b1) + 32);
        }

        return _b1;
    }
}
